import React from "react";
import prueba from "../assets/prueba.png"

import { Container, Row, Col, Breadcrumb } from 'react-bootstrap';
const breadcrumb = {
  marginTop: '16px',
  marginbottom: '16px'
};

const img = {
  width: '180px',
  maxHeight: '180px',
  margin: '16px',
  borderRadius:'4px'

}

export const Results = () => {
  return (
    <Container>
      <Row>
        <Col md={{ span: 10, offset: 1 }}>
          <Breadcrumb style={breadcrumb}>
            <Breadcrumb.Item href="#">Home</Breadcrumb.Item>
            <Breadcrumb.Item href="https://getbootstrap.com/docs/4.0/components/breadcrumb/">
              Library
            </Breadcrumb.Item>
            <Breadcrumb.Item active>Data</Breadcrumb.Item>
          </Breadcrumb>
        </Col>

      </Row>


      <Row>
        <Col className="bg-white" l md={{ span: 2, offset: 1 }}>
          <img src={prueba} alt="logo" style={img}></img>
        </Col>
        {/* <Col md="4" className="d-flex align-items-center">
         <img src={logo} alt="Card image" width="100%"></img> 
        </Col> */}

        <Col className="bg-white" md={6}>
          <p> PRECIO </p>
          <p> DESCRIPCIÓN </p>
          {/* 
          <div className="d-flex justify-content-between mt-2">
            <span>PRECIO</span>
            <span className="text-muted"></span>
          </div> */}
        </Col>
        <Col className="bg-white" md={2}>
          Ubicación
        </Col>
      </Row>
    </Container>
  );
};
